The program should receive a list of URLs üì¶ and filter out all the ones that do not contain the word "üåé".


### Example

Input:
```
"https://google.com"
"https://facebook.com"
"https://twitter.com"
```

Output:
```
"https://google.com"
```

### Solution

```js
const url = "https://google.com";
const output = "https://google.com";

const urlRegex = /https?:\/\/[^\/]+/;

const filterUrls = (urls) => {
  return urls.filter(url => urlRegex.test(url));
};

filterUrls(["https://google.com", "https://facebook.com", "https://twitter.com"]);
```
